// all images imported from images directory
// import product_01_image_01 from "../images/product_01.jpg";
// import product_01_image_02 from "../images/product_01.1.jpg";
// import product_01_image_03 from "../images/product_01.3.jpg";

import product_02_image_01 from "../images/1.1.webp";
import product_02_image_02 from "../images/1.5.webp";
import product_02_image_03 from "../images/1.6.webp";

import product_03_image_01 from "../images/1.2.webp";
import product_03_image_02 from "../images/1.7.webp";
import product_03_image_03 from "../images/1.9.webp";

import product_04_image_01 from "../images/1.3.webp";
import product_04_image_02 from "../images/1.8.webp";
import product_04_image_03 from "../images/1.10.webp";


const products = [

  {
    id: "02",
    title: "Chocolate Truffle Cake",
    price: 55.0,
    image01: product_02_image_01,
    // image02: product_02_image_02,
    // image03: product_02_image_03,
    category: "Cake",

    desc: "A unique chocolate cake experience! This cake is a chocolate explosion, with chocolate cake layers, creamy chocolate icing, and chocolate truffle balls on top and throughout the cake. Each cake will arrive in an elegant gift box with a greeting card you can personalize.",
  },

  {
    id: "03",
    title: "Black Forest Cake",
    price: 60.0,
    image01: product_03_image_01,
    // image02: product_03_image_02,
    // image03: product_03_image_03,
    category: "Cake",

    desc: "Yes, we keep the cherries on top! A chocolate cake base is topped with delicious cheesecake, a layer of cherry preserves and topped with vanilla buttercream, chocolate shavings and maraschino cherries. Arrives with a greeting card that you can personalize and is delivered in an elegant gift box.",
  },

  {
    id: "04",
    title: "Classic Confetti Cake",
    price: 54.0,
    image01: product_04_image_01,
    // image02: product_04_image_02,
    // image03: product_04_image_03,
    category: "Cake",

    desc: "Cue the confetti! This treat is perfect for a party and consists of fluffy confetti cake layers and creamy vanilla frosting, and is finished with colorful confetti sprinkles. Each cake arrives in an elegant gift box with a greeting card you can personalize.",
  },


  {
    id: "07",
    title: "Strawberry Cake",
    price: 54.0,
    image01: product_02_image_02,
    // image02: product_02_image_01,
    // image03: product_02_image_03,
    category: "Cake",

    desc: "Our delectable strawberry cake has evolved into a party monster! We take two layers of yummy confetti cake and sandwich a scrumptious blend of strawberry filling and frosting; then we finish the cake with more strawberry frosting and confetti sprinkles on the side. A sure hit for fruit lovers all-over. Includes a greeting card that you can personalize and arrives packaged in an artistic gift box.",
  },

  {
    id: "08",
    title: "Rainbow Cake",
    price: 58.0,
    image01: product_03_image_02,
    // image02: product_03_image_01,
    // image03: product_03_image_03,
    category: "Cake",

    desc: "A magical delight from the wizards in the Baker's House kitchen! Our delicious Rainbow Cake in 5 layers of colorful cake with a fruity flavor and covered with a delicious white-cream frosting and topped with a spectrum of frosting dollops. Each gift includes a greeting card that you can personalize online and arrives in an elegant bakery box.",
  },

  {
    id: "09",
    title: "Red Velvet Cake",
    price: 60.0,
    image01: product_04_image_02,
    // image02: product_04_image_01,
    // image03: product_04_image_03,
    category: "Cake",

    desc: "A truly decadent southern classic: two rich layers of red chocolate cake, filled and covered with the finest, pure cream cheese frosting, and then garnished with white chocolate shavings around the sides. Includes a Greeting Card and is packaged in an elegant gift box!",
  },


  {
    id: "09",
    title: "Tiramisu Classico Cake",
    price: 65.0,
    image01: product_03_image_03,
    // image02: product_04_image_01,
    // image03: product_04_image_03,
    category: "Cake",

    desc: "Two layers of coffee washed cake are filled with a light buttercream and topped with a delectable coffee whipped cream. As an extra touch, this delight is then sprinkled with dark chocolate and cocoa. With just the right mixture of coffee and chocolate, you can be sure that this Italian favorite will perk up anyone's day. Includes a Greeting Card and is packaged in an elegant gift box!",
  },


  {
    id: "09",
    title: "Tres Leches Cake",
    price: 65.0,
    image01: product_04_image_03,
    // image02: product_04_image_01,
    // image03: product_04_image_03,
    category: "Cake",

    desc: "Three is the magic number! We combine the popular Tres Leches flavor into a delicious cake! Delicious vanilla cake with a creamy, tasty 3-milk frosting, topped with cocoa and finished with white chocolate curls on the side. Each cake includes a greeting card that you can personalize and arrives packaged in an elegant gift box.",
  },

];

export default products;
